  02> MACLEAN, Adrian Mark
  b 10.11.1992
  Adrian b, at Ottawa, Canada.
  03> MACLEAN, Lesley Janet
  b 29.09.1962
  Lesley b. in Ottawa, Ontario, Canada. Address: 32 Dominion Avenue, Christchurch 2.
  Lesley was educated at Burnside High School in Christchurch, Christchurch Polytechnic (Diploma of
  Visual Communications) and Auckland University. She spent three years at Urasenke Gakuen Chado
  Senmon Gakko in Kyoto, Japan, earning a diploma of Japanese Tea Ceremony (in the midorikai
  program). Subsequently she lived and worked at the Lama Foundation (educational and retreat
  centre) in New Mexico, USA and was coordinator there for two years. In 1998 she moved back to New
  Zealand where she works as a graphic designer and instructor of Japanese Tea Ceremony.
  01> MACLEAN, Michael Anson m on 01.07.1977 to (2) PAINE, Anne
  b 19.12.1930
  b 23.12.1933
  Michael m. at Christchurch. Anne, d/o of Leonard Charles Horwood and Irene Annie Elizabeth Taylor, b.
  at Lower Hutt. Address: 7 Pembridge Lane, Westmorland, Christchurch 3.
  Anne was educated at Christchurch Girls' High School and Kindergarten Teachers' College (Kindergarten
  Teaching Diploma). She also has a Diploma of Recreation and Sport. She has worked as a teacher, Arts
  administrator, Director of Christchurch YWCA, and Community Affairs Officer for a local authority. She
  is a justice of the Peace. In 1990 she was a co-founder and the first administrator of the Gestalt
  Institute of NZ as well as its first Diploma graduate. She is now in private practice as a Gestalt
  psychotherapist and supervisor and a consultant in Human Resource Management. She has three grown-up
  children and six grandchildren.
  02> MACLEAN, Dorothy Margaret
  b 04.03.1933
  Dorothy b, at Wellington. Address: C/- 7 Pembridge Lane, Westmorland, Christchurch 8003.
  She was educated at Nga Tawa, Marton, and Victoria University (BSc). She worked as a laboratory
  technician at Wellington Hospital. She has a major interest in music and plays the cello in chamber
  music groups and the Wellington Chamber Orchestra.
  09> MACLEAN, Frederick Hector m on 27.01.1922 to REID, Vernice Ethel
  b 25.05.1894 d 07.11.1948
  b 03.09.1895 d 07.08.1977
  Hector b. at Waipawa, m. at Waipukurau and d. at Dunedin. Vernice, d/o John Emslie Reid and
  Esther Amelia Young, d. at Gisborne.
  Hector was educated at Wanganui Collegiate School where he was Head Prefect. He worked in
  Williams and Kettle's store before going farming with his brother Lionel at Puha about 20
  miles from Gisborne.
  Vernice spent her early years on a farm near Whangaehu before her family moved to farm in
  Hawkes Bay on land now partly occupied by the township of Waipukurau. She was educated at Chilton House,
  Wellington, then worked in a bank for several years before training as a Karitane nurse.
  Hector and Vernice spent several years at Puha after their marriage before moving to Toromiro, a sheep farm
  on the Whakarai Road, 40 miles from Gisborne. Because of Hector's poor health, they had to leave the farm
  about 1946 and move to Gisborne. There Hector worked for several years in the office of Odlin Timber
  Company.
